import { Container, Text } from '@mantine/core';


function Orders(props){
  const arr = props.arr;

  const renderList = arr.map((item) => 
                             <div>{item}</div>
                           );

  return (
    <>
      <ul>{renderList}</ul>

    </>
  );
}

export default Orders;
